import groovy.xml.XmlUtil

// Get the request XML
def mockRequestContent = mockRequest.getRequestContent()
def slurper = new XmlSlurper()
def requestXml = slurper.parseText(mockRequestContent).declareNamespace('web': 'http://webservice.ahbx.accenture.com/')

// Get the key elements of the request XML
addUpdateCertificationInfoRequest = requestXml.'**'.find{it.name() == "addUpdateCertificationInfo"}
firstName = addUpdateCertificationInfoRequest.arg0.firstName.text()
recordId = addUpdateCertificationInfoRequest.arg0.recordId.text()

// Get the ahbxmocks.properties file
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def projectDir = groovyUtils.projectPath
def ahbxmocksPropertiesFile = projectDir + '/' + 'ahbxmocks.properties'
Properties propertiesFromFile = new Properties();
propertiesFromFile.load(new FileInputStream(ahbxmocksPropertiesFile));

// Set the response content of the response XML using the correct template
if (firstName == "IND35RandomFailure") {
	randomNumber = Math.abs(new Random().nextInt() % 100)
	if (randomNumber > propertiesFromFile.mockCertificationInfoEndPointImplServiceSoapBindingFailureRate.toInteger()) {
		 returnDefaultResponseTemplate(recordId,"200","SUCCESS")
	} else {
		returnDefaultResponseTemplate(recordId,"400","FAILURE")
	}
} else if (firstName == "IND35Failure") {
	returnDefaultResponseTemplate(recordId,"400","FAILURE")
} else {
	returnDefaultResponseTemplate(recordId,"200","SUCCESS")
}

def returnDefaultResponseTemplate (recordId, responseCode, responseDesc) {
	context.recordId = recordId
	context.responseCode = responseCode
	context.responseDesc = responseDesc

	context.responseContent = mockOperation.getMockResponseByName("DefaultMockResponseTemplate").getResponseContent()
}

