import groovy.xml.XmlUtil

// Get the request XML
def mockRequestContent = mockRequest.getRequestContent()
def slurper = new XmlSlurper()
def requestXml = slurper.parseText(mockRequestContent).declareNamespace('impl': 'http://impl.webservice.ahbx.accenture.com/')

// Get the key elements of the request XML
retrieveDelegationCodeRequest = requestXml.'**'.find{it.name() == "retrieveDelegationCode"}
firstName = retrieveDelegationCodeRequest.arg0.firstName.text()
recordId = retrieveDelegationCodeRequest.arg0.recordId.text()
recordType = retrieveDelegationCodeRequest.arg0.recordType.text()

def generator = { String alphabet, int n ->
  new Random().with {
    (1..n).collect { alphabet[ nextInt( alphabet.length() ) ] }.join()
  }
}

// Get the ahbxmocks.properties file
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def projectDir = groovyUtils.projectPath
def ahbxmocksPropertiesFile = projectDir + '/' + 'ahbxmocks.properties'
Properties propertiesFromFile = new Properties();
propertiesFromFile.load(new FileInputStream(ahbxmocksPropertiesFile));

// Set the response content of the response XML using the correct template
if (firstName == "IND54RandomFailure") {
	randomNumber = Math.abs(new Random().nextInt() % 100)
	if (randomNumber > propertiesFromFile.mockDelegateAccessCodeEndPointImplServiceSoapBindingFailureRate.toInteger()) {
		delegationCode = generator( ('0'..'9').join(), 4 )
		returnDefaultResponseTemplate(delegationCode,recordId,recordType,"200","success")
	} else {
		delegationCode = ""
		returnDefaultResponseTemplate(delegationCode,recordId,recordType,"400","failure")
	}
} else if (firstName == "IND54Failure") {
	delegationCode = ""
	returnDefaultResponseTemplate(delegationCode,recordId,recordType,"400","failure")
} else {
	delegationCode = generator( ('0'..'9').join(), 4 )
	returnDefaultResponseTemplate(delegationCode,recordId,recordType,"200","success")
}

def returnDefaultResponseTemplate (delegationCode, recordId, recordType, responseCode, responseDescription) {

	context.delegationCode = delegationCode
	context.recordId = recordId
	context.recordType = recordType
	context.responseCode = responseCode
	context.responseDescription = responseDescription

	context.responseContent = mockOperation.getMockResponseByName("DefaultMockResponseTemplate").getResponseContent()
}

